.pl-ent, .cm-tag {
    color: #FF5370;
}
.pl-k, .cm-def {
    color: #89DDFF;
}
.pl-smw, .pl-v {
    color: #F78C6C;
}
.cm-qualifier {
	color: #FFCB6B;
}
.blob-code-deletion {
    background-color: hsla(353, 25%, 30%, 1);
}
.blob-num-deletion {
    background-color: hsla(353, 25%, 25%, 1);
    border-color: hsla(353, 25%, 20%, 1);
}
.blob-code-addition {
    background-color: hsla(137, 25%, 30%, 1);
}
.blob-num-addition {
    background-color: hsla(137, 25%, 25%, 1);
    border-color: hsla(137, 25%, 20%, 1);
}
.blob-code-addition .x {
    background-color: hsla(135, 73%, 30%, 1);
}
.blob-code-deletion .x {
    background-color: hsla(353, 73%, 30%, 1);
}
.blob-code-inner.highlighted, .blob-code-inner .highlighted {
    background-color: hsla(39, 25%, 30%, 1);
}
.timeline-comment
{
    color: inherit;
}
/* comments */
 .comment-body, .markdown-body, .js-comment-body {
    color: rgba(255, 255, 255, 0.7) !important;
}
/* timeline background lines, badges, etc */
 .TimelineItem-break {
    background-color: var(--bg3) !important;
    border-top: 4px solid var(--bg5) !important;
}
.TimelineItem:before {
    background-color: var(--bg5) !important;
}
.TimelineItem-badge {
    border: 2px solid var(--bg5) !important;
}
/* tabs on the comment box and such, Write, Preview, etc  */
 .tabnav-tab.selected, .tabnav-tab[aria-selected=true] {
    background-color: var(--bg5) !important;
    border-color: var(--bg4) !important;
}
/* badges, like bug, feature, etc, */
 .protip code {
    background-color: var(--bg5) !important;
    padding: 3px;
}
.menu-item.selected {
	background-color: var(--bg4)
}
.menu .menu-item:hover{
	background-color: var(--bg5) !important;
}
.timeline-comment--caret:after,
.timeline-comment--caret:before{
    border-right-color: var(--bg1);
}
.Popover-message:after {
	border-bottom-color: var(--bg1);
}
.Popover-message--bottom-left:after, .Popover-message--bottom-right:after, .Popover-message--bottom:after {
    border-top-color: var(--bg1);
}
.Popover-message--right-bottom:after, .Popover-message--right-top:after, .Popover-message--right:after {
    border-left-color: var(--bg1);
}
.select-menu-tabs .select-menu-tab-nav.selected, .select-menu-tabs .select-menu-tab-nav[aria-selected=true], .select-menu-tabs a.selected, .select-menu-tabs a[aria-selected=true] {
    color: #24292e;
    background-color: var(--btn);
    border-color: var(--btn);
}
.TimelineItem-badge {
	background-color: var(--bg5);
}
.TimelineItem-badge .octicon {
	fill: hsla(0, 0%, 100%, 0.5);
}
.TimelineItem-body {
    color: hsla(0, 0%, 100%, 0.33);
}
.commit-ref, .branch-name {
    color: hsla(0, 0%, 100%, 0.4);
}
.diffbar, .pr-toolbar {
    background-color: var(--bg3);
}
.orghead {
    background-color: var(--bg1);
}

.commit-ref .user {
    color: var(--selected);
}

@media (min-width: 768px){
	.page-responsive .pagehead {
		background-color: var(--bg2)!important;
	}
}

.blob-expanded .blob-code, .blob-expanded .blob-num {
    background-color: var(--bg6);
}

.comment-reactions .user-has-reacted {
    background-color: var(--bg1);
}

@media (min-width: 1012px) {
	.border-lg-left {
    	border-left: 1px solid var(--bg2)!important;
	}
	.border-lg-bottom {
    	border-bottom: 1px solid var(--bg2)!important;
	}
	.border-lg-right {
    	border-right: 1px solid var(--bg2)!important;
	}
	.border-lg-top {
    	border-top: 1px solid var(--bg2)!important;
	}
}

/* Profile Contributions */
rect.day {
    fill: hsl(174, 38%, 60%);
}
rect.day[data-count="0"] {
    fill: var(--bg1) !important;
}
rect.day[data-count="1"],
rect.day[data-count="2"],
rect.day[data-count="3"],
rect.day[data-count="4"] {
	fill: hsl(174, 38%, 15%);
}
rect.day[data-count="5"],
rect.day[data-count="6"],
rect.day[data-count="7"],
rect.day[data-count="8"],
rect.day[data-count="9"] {
	fill: hsl(174, 38%, 30%);
}
rect.day[data-count="10"],
rect.day[data-count="11"],
rect.day[data-count="12"],
rect.day[data-count="13"],
rect.day[data-count="14"] {
	fill: hsl(174, 38%, 45%);
}
ul.legend li:nth-of-type(1) {
    background: var(--bg1) !important;
}
ul.legend li:nth-of-type(2) {
    background: hsl(174, 38%, 15%) !important;
}
ul.legend li:nth-of-type(3) {
    background: hsl(174, 38%, 30%) !important;
}
ul.legend li:nth-of-type(4) {
    background: hsl(174, 38%, 45%) !important;
}
ul.legend li:nth-of-type(5) {
    background: hsl(174, 38%, 60%) !important;
}
.TimelineItem--condensed .TimelineItem-badge {
    background-color: var(--bg3);
    border-color: var(--bg3) !important;
}

/* New notifications system */
.notifications-list-item .notification-list-item-link {
    color: rgba(255, 255, 255, 0.4) !important;
}
.notifications-list-item.notification-unread {
    background-color: var(--bg6);
}
.notifications-list-item.notification-unread .notification-list-item-link {
    color: rgba(255, 255, 255, 0.9)!important;
}
.notifications-list-item:hover {
    background-color: var(--bg5)!important;
}
.notifications-list-item:hover .notification-list-item-link {
    color: rgba(255, 255, 255, 0.6) !important;
}
.notifications-list-item .Label {
    background-color: rgba(255, 255, 255, 0.1)!important;
    color: rgba(255, 255, 255, 0.4)!important;
}
.notifications-list-item:hover .notification-list-item-actions .btn:hover {
    color: rgb(255, 255, 255)!important;
    background-color: var(--selected)!important;
}
.notification-navigation .notification-configure-filters:hover .octicon {
    color: var(--selected)!important;
}
.notification-navigation .filter-item:not(.selected):hover {
    color: rgba(255,255,255,0.9)!important;
}
.card-filter-autocomplete-dropdown .navigation-focus, .card-filter-autocomplete-dropdown [aria-selected=true] {
    background-color: var(--selected2);
}
